INSERT INTO `product` VALUES (16,158,'9421901167004',NULL,'诺丽酵素原浆750ml','Life Health Noni Juice  750ml',NULL,'attachment/img/2018-10-26/诺丽酵素原浆750ml_主图5.jpg',0,1,1,0,0,1,NULL,NULL,1,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,0,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-26/%E8%AF%BA%E4%B8%BD%E9%85%B5%E7%B4%A0%E5%8E%9F%E6%B5%86750ml.jpg\" style=\"width: 773px; height: 4035px;\" /></p>\r\n','','','2018-09-18 11:05:44','2018-09-18 11:05:44','NZ','',0,NULL,'',''),(17,200,'9421008702740',NULL,'Skin Therapy龙血微雕小脸精华 龙血小银瓶 30ml','Skin Therapy drangon‘s blood sculpting serum 30ml',NULL,'attachment/img/2018-10-26/龙血小银瓶30ml_主图1.jpg',0,1,1,0,0,1,NULL,NULL,1,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,0,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-26/%E9%BE%99%E8%A1%80%E5%B0%8F%E9%93%B6%E7%93%B630ml.jpg\" style=\"width: 774px; height: 5231px;\" /></p>\r\n','','','2018-09-18 11:05:44','2018-09-18 11:05:44','NZ','',0,NULL,'',''),(18,NULL,'4210201146575',NULL,'电动牙刷(多角度)','oral-b electric toothbrush （cross action）',NULL,'attachment/img/2018-10-13/oralb电动牙刷.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,0,NULL,'<p>1：一个充电器（座充，感应充电）</p>\r\n\r\n<p>2：一个机身，也就是刷柄</p>\r\n\r\n<p>3：此款牙刷自带2个刷头。</p>\r\n\r\n<p>4：说明书一份（英文）&nbsp;</p>\r\n\r\n<p>5、有2分钟自动提醒功能。</p>\r\n\r\n<p>6、此型号牙刷防水和不会过充，可以放在卫生间使用，不用的时候可以随时插在充电座上保持满电。</p>\r\n\r\n<p>7、连续充电16个小时可以充满，之后可以使用大概5天（每天刷牙2次，每次2分钟）。</p>\r\n\r\n<p>【注意事项】</p>\r\n\r\n<p>1.&nbsp;建议每三个月换一次刷头，第一是为了保证刷牙效果，第二是因为牙刷其实也挺容易脏的，即时更换可以避免细菌的侵袭，保持口腔健康！</p>\r\n\r\n<p>2.&nbsp;这个澳洲的产品，都是三角插的，所以家里没有三角插的，注意用一个转换插头啊！</p>\r\n\r\n<p>3.&nbsp;牙刷是100%德国原装进口，采购于澳洲超市。刷头德国制造，刷柄和插座中国制造，小伙伴们请知悉！</p>\r\n','','','2018-09-18 11:05:44','2018-09-18 11:05:44','NZ','',0,NULL,'',''),(19,NULL,'9310297005628',NULL,'洛神红酒750ml','Rawson‘s retreat 750ml',NULL,'',0,1,1,0,0,1,0,0,0,0,0,NULL,0,1,0.00,0.00,NULL,0.00,NULL,0,NULL,'',NULL,NULL,'2018-09-18 11:05:44','2018-09-18 11:05:44',NULL,NULL,0,NULL,NULL,NULL),(20,158,'93117705