,0.00,NULL,0,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-24/%E8%8E%B1%E6%96%87%E5%8C%BB%E7%94%9F%E5%85%AB%E8%83%9C%E8%82%BD%E9%9D%A2%E8%86%9C3%E7%89%8701.jpg\" style=\"width: 774px; height: 4526px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-24/%E8%8E%B1%E6%96%87%E5%8C%BB%E7%94%9F%E5%85%AB%E8%83%9C%E8%82%BD%E9%9D%A2%E8%86%9C3%E7%89%8702.jpg\" style=\"width: 774px; height: 6384px;\" /></p>\r\n','','','2018-09-18 11:05:49','2018-09-18 11:05:49','NZ','',0,NULL,'',''),(72,181,'9400569017500',NULL,'好健康辅酶Q10 150mg 90粒','Goodhealth opti CoQ10 150mg 90c',NULL,'attachment/img/2018-10-24/好健康辅酶Q10 150mg 90粒_主图5.jpg',28.7,29.5,1,0,0,1,1,NULL,NULL,NULL,0,NULL,0,1,4.00,0.00,NULL,0.00,NULL,0,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-24/%E5%A5%BD%E5%81%A5%E5%BA%B7%E8%BE%85%E9%85%B6Q10%20150mg%2090%E7%B2%92_desc9.jpg\" style=\"width: 750px; height: 823px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-24/%E5%A5%BD%E5%81%A5%E5%BA%B7%E8%BE%85%E9%85%B6Q10%20150mg%2090%E7%B2%92_desc10.jpg\" style=\"width: 750px; height: 1164px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-24/%E5%A5%BD%E5%81%A5%E5%BA%B7%E8%BE%85%E9%85%B6Q10%20150mg%2090%E7%B2%92_desc11.jpg\" style=\"width: 750px; height: 929px;\" /></p>\r\n','','','2018-09-18 11:05:49','2018-09-18 11:05:49','NZ','',0,NULL,'',''),(73,158,'9300807205211',NULL,'blackmoresm天然维生素E','Blackmores Natural E 500IU 150s',NULL,'attachment/img/2018-10-24/Blackmores纯天然维生素E 500IU 150粒.jpg',25.9,26.9,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,6.00,0.00,NULL,0.00,NULL,0,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-24/blackmoresm%E7%BB%B4%E7%94%9F%E7%B4%A0E%20150%E7%B2%9201.jpg\" style=\"width: 814px; height: 3613px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-24/blackmoresm%E7%BB%B4%E7%94%9F%E7%B4%A0E%20150%E7%B2%9202.jpg\" style=\"width: 814px; height: 3206px;\" /></p>\r\n','','','2018-09-18 11:05:49','2018-09-18 11:05:49','NZ','',0,NULL,'',''),(74,158,'94575507',NULL,'THOMPSONS 生物素','Thompson Biotin 150mcg 100t',NULL,'attachment/img/2018-10-24/汤普森 生物护发素 100片.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,0,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-24/%E6%B1%A4%E6%99%AE%E6%A3%AE%20%E7%94%9F%E7%89%A9%E6%8A%A4%E5%8F%91%E7%B4%A0.jpg\" style=\"width: 774px; height: 2559px;\" /></p>\r\n','','','2018-09-18 11:05:49','2018-09-18 11:05:49','NZ','',0,NULL,'',''),(75,158,'9300807220115',NULL,'BLACKMORES 维生素B  125粒','Blackmores Executive B 125s',NULL,'attachment/img/2018-10-24/BLACKMORES维生素B 125粒.jpg',24,23.5,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,6.00,0.00,NULL,0.00,NULL,0,NULL,'<p>【产品名称】Blackmores&nbsp;Executive&nbsp;B&nbsp;压力舒缓配方&nbsp;125片</p>\r\n\r\n<p>【用法用量】成人：每日一片，早午餐时服用。</p>\r\n\r\n<p>【主要功效】&nbsp;&nbsp;&nbsp;<br />\r\n用来减轻由于繁忙生活所造成的压力和紧张.帮助身体更好地对抗压力。&nbsp;本品含有维生素、矿物质和草药，让神经系统能更好地对付持续的紧张和压力。<br />\r\n1.为身体压力应对机能提供支持。<br />\r\n2.含有的营养素和草本植物成分，用于减压和舒缓紧张以由来已久，能有效支持和维护神经系统和肾上腺的运作。<br />\r\n3.有助于食物转化为能量。<br />\r\n4.本品&nbsp;黄褐色斑驳扁平药片，药片的薄膜包衣为深棕色。<br />\r\n5.服食前请认真阅读标签并按指示使用。<br />\r\n6.本品含有麸质，过敏者慎用。<br />\r\n7.如果症状持续，建议尽快就医。<br />\r\n8.孕期或哺乳期怀孕女性使用本品，应遵医嘱。<br />\r\n9.本品有利尿成分，因此考虑使用本品前，请咨询您的专业保健顾问意见，或你个人接受利尿现象。<br />\r\n10.镁和钙可降低某些药物的吸收和疗效。为此，若您在服用本品时还需要服用四环素或喹诺酮类抗生素、二膦酸盐（骨质疏松症的药物）或甲状腺激素，请与本品相隔至少2小时服用。<br />\r\n11.沉重的精神压力，特别是长时间持续、不间断的压力或，对神经系统和肾上腺都会造成损害。这可能会导致肾上腺&ldquo;精疲力竭&rdquo;，让您感觉除了累还是累，甚至&ldquo;心力交瘁&rdquo;。<br />\r\n12.B族维生素对激素和神经递质有重要作用，是神经神经系统的正常运转和得以维持的基础。例如维生素B5，在舒缓压力上扮演着重要角色，因为它在肾上腺的运作中起着核心作用。同样，叶酸、肌醇和维生素B6参与情绪支持激素（如血清素）的制造和功效发挥。<br />\r\n13.B族维生素也作为辅酶，参与所有活细胞的各种新陈代谢反应，包括把食物中的碳水化合物、蛋白质和脂肪转化为能量。<br />\r\n14.本品中含有维生素C、锌、镁等营养素，它们为B族维生素支持肾上腺和神经系统的功能起到积极的辅助作用。<br />\r\n15.压力、剧烈的体力活动，以及酒后都有可能增加对本品所含营养素的需求，因此，在这些情况下，补充本品所含营养素是有益的。<br />\r\n16.本品还含有草药西番莲和燕麦，历来被用于舒缓神经系统紧张，是温和的镇静剂。</p>\r\n\r\n<p>【产品成份】<br />\r\n维生素B1（盐酸硫胺）5毫克<br />\r\n维生素B2（核黄素）&nbsp;10毫克<br />\r\n烟酰胺&nbsp;100&nbsp;mg&nbsp;100毫克<br />\r\n维生素B5&nbsp;68.7毫克<br />\r\n维生素B6（盐酸吡多辛）&nbsp;25毫克<br />\r\n维生素B12&nbsp;30微克<br />\r\n维生素的H（生物素）&nbsp;20&nbsp;&mu;&nbsp;g<br />\r\n抗坏血酸钙&nbsp;145&nbsp;mg&nbsp;145毫克<br />\r\n维生素C&nbsp;250&nbsp;mg<br />\r\n维生素E&nbsp;50&nbsp;IU<br />\r\n磷酸镁&nbsp;140毫克<br />\r\n磷酸钙&nbsp;100毫克<br />\r\n钾磷一元&nbsp;117.3毫克<br />\r\n叶酸&nbsp;150&nbsp;&mu;g<br />\r\n卵磷脂50毫克<br />\r\n胆碱25毫克<br />\r\n肌醇&nbsp;25毫克</p>\r\n\r\n<p>【健康信息】:</p>\r\n\r\n<p>维生素B族的作用：<br />\r\n维生素B族有十二种以上，被世界一致公认的有九种，全是水溶性维生素，在体内滞留的时间只有数小时，必须每天补充。B族是所有人体组织比不可少的营养素，是食物释放能量的关键。全是辅酶，参与体内糖、蛋白质和脂肪的代谢，因此被列为一个家族。</p>\r\n\r\n<p>所有的维生素B必须同时发挥作用，称为VB的融合作用。单独摄入某种VB，由于细胞的活动增加，从而使对其它VB的需求跟着增加，所以各种VB的作用是相辅相成的，所谓&ldquo;木桶原理&rdquo;。罗杰.威廉博士指出，所有细胞对VB的需求完全相同。<br />\r\n维生素B大家族最经常的成员有B1、B2、B3（烟酸）、B5（泛酸）、B6、B11（叶酸）B12（钴胺素）。它们的作用分述如下。<br />\r\n1．是糖代谢过程中关键性的物质。身体的肌肉和神经所需能量主要由糖类提供，所以最易受累。VB充足，则神经细胞能量充沛，可以缓解忧虑、紧张，增加对噪音等的承受力；反之，导致应对压力的能力衰退，甚至引发神经炎。<br />\r\n心脏功能由于丙酮酸、乳酸的沉积而受影响。肠胃匮缺能量，蠕动无力，消化功能减弱，且产生便秘。<br />\r\n严重时引发脚气病。它的演化过程是：体虚&mdash;疲倦&mdash;烦躁、情绪低落&mdash;便秘&mdash;神经炎&mdash;心痛&mdash;心衰&mdash;水肿。1897年荷兰医生发现食用精米可导致脚气病，主要是因为缺乏维生素B1，所以B1也叫做抗脚气病维生素。<br />\r\n2．和糖、蛋白质、脂肪的代谢密切相关。维持和改善上皮组织，如眼睛的上皮组织、消化道黏膜组织的健康。严重缺乏时会有视力疲劳、角膜充血、口角炎等。当口角炎时医生常常会要患者服用核黄素，也就是B2。<br />\r\n3．脂肪代谢不良会引起溢脂性皮炎、痘痘、痤疮，补充维生素B有很好的效果。<br />\r\n4．缺乏B族以至胃肠蠕动无力、消化液分泌不良，造成消化不良、便秘、口臭、大便奇臭。<br />\r\n5．B3在体内构成脱氢酶的辅酶，在碳水化合物、蛋白质、脂肪的代谢中起重要作用，严重缺乏时引起神经、皮肤、消化道病变，叫做癞皮病，也叫三D症，表现为皮炎、腹泻和痴呆。<br />\r\n6．帮助身体组织利用氧气，促进皮肤、指甲、毛发组织的获氧量，祛除或改善头皮屑。</p>\r\n\r\n<p>7．解除酒精和尼古丁等毒素，舒缓头痛、偏头痛、保护肝脏。<br />\r\n8．B11、B12的缺乏将影响胸腺嘧啶、嘌呤、等的合成，引起DNA合成障碍。最终导致红细胞的细胞核不成熟，生成无效性红细胞，这就是巨幼细胞性贫血。<br />\r\n9．如在怀孕头3个月内缺乏叶酸，可导致胎儿神经管畸形，从而增加裂脑儿，无脑儿的发生率。<br />\r\nB族维生素（主要是维生素B2）具有一种特殊的气味，是蚊子最讨厌的维生素，因而具有一定程度的驱蚊效果。<br />\r\n维生素B包括维生素B1、维生素B2、维生素B6、维生素B12、烟酸、泛酸、叶酸等。这些B族维生素是推动体内代谢，把糖、脂肪、蛋白质等转化成热量时不可缺少的物质。如果缺少维生素B，则细胞功能马上降低，引起代谢障碍，这时人体会出现怠滞和食欲不振。相反喝酒过多等导致肝脏损害，在许多场合下是和维生素B缺乏症并行的。<img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-24/BLACKMORES%E7%BB%B4%E7%94%9F%E7%B4%A0B%20125%E7%B2%92_desc2.png\" style=\"width: 750px; height: 334px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-24/BLACKMORES%E7%BB%B4%E7%94%9F%E7%B4%A0B%20125%E7%B2%92_desc3.jpg\" style=\"width: 750px; height: 212px;\" /></p>\r\n','','','2018-09-18 11:05:49','2018-09-18 11:05:49','NZ','',0,NULL,'',''),(76,192,'9322316001108',NULL,'GM 澳芝曼绵羊油  ','G&M Lanolin Cream 250G',NULL,'attachment/img/2018-10-24/GM绵羊油_主图2.jpg',0,1,1,0,0,1,1,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,0,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-24/GM%E7%BB%B5%E7%BE%8A%E6%B2%B9.jpg\" style=\"width: 814px; height: 7509px;\" /></p>\r\n','','','2018-09-18 11:05:49','2018-09-18 11:05:49','NZ','',0,NULL,'',''),(77,158,'9400575001258',NULL,'Thompsons 汤普森 VE胶囊 100粒','thompsons Vitamin E 500IU 100c',NULL,'attachment/img/2018-10-24/维生素E.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,0,NULL,'<p><strong data-spm-anchor-id=\"2013.1.0.i0.72d443846UKSYK\">Thompson&#39;s 汤普森 天然VE维生素E 100粒</strong></p>\r\n\r\n<p><strong>本产品不可替代药品！</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>维生素E可以用来促进心脏、免疫和眼睛健康和协助症状相关的记忆力下降。它也有助于缓解一些经前期不适。</strong></p>\r\n\r\n<p><strong>维生素E可能既适用于内部和外部(直接用于皮肤)来改善伤口愈 &nbsp;合和皮肤问题，如皮yan和湿zhen。400-800iu每日推荐。</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>维生素E是一种通用的术语,一组相关的生育酚,其中有四个主要形式:&alpha;、&beta;,delta和gamma-tocopherols</strong></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>维他命E具抗氧化作用,</strong></p>\r\n\r\n<p><strong>有证据表明,维生素E提高免疫力功能,特别是老年人,对抗有害化学物质和空气污染。</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>【用 &nbsp; &nbsp; &nbsp;量】</strong></p>\r\n\r\n<p><strong>每日1-2粒随餐服用或遵医嘱</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>注意：此产品含硒，如果平时还在单独补充硒的话就不要吃这款ve啦！因为这款ve已经含硒了！</strong></p>\r\n','','','2018-09-18 11:05:49','2018-09-18 11:05:49','NZ','',0,NULL,'',''),(78,158,'499064',NULL,'blackmore B族75粒','Blackmores Mega B Complex (75 tab)',NULL,'atta