20500%E7%B2%92_desc6.jpg\" style=\"width: 945px; height: 892px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-23/prolife%20%E5%84%BF%E7%AB%A5%E7%94%9F%E9%95%BF%E7%B4%A0%20500%E7%B2%92_desc7.jpg\" style=\"width: 945px; height: 654px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-23/prolife%20%E5%84%BF%E7%AB%A5%E7%94%9F%E9%95%BF%E7%B4%A0%20500%E7%B2%92_desc8.jpg\" style=\"width: 945px; height: 537px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-23/prolife%20%E5%84%BF%E7%AB%A5%E7%94%9F%E9%95%BF%E7%B4%A0%20500%E7%B2%92_desc9.jpg\" style=\"width: 945px; height: 680px;\" /></p>\r\n','','','2018-09-18 11:05:52','2018-09-18 11:05:52','NZ','',0,NULL,'',''),(108,193,'9421001820014',NULL,'老奶奶臭脚粉--原味 50g','Grans Remedy foot powder original 50g',NULL,'attachment/img/2018-10-21/老奶奶臭脚粉_主图2.jpg',0,1,1,0,0,1,1,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,3,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-21/%E8%80%81%E5%A5%B6%E5%A5%B6%E8%87%AD%E8%84%9A%E7%B2%89.jpg\" style=\"width: 814px; height: 7559px;\" /></p>\r\n','','','2018-09-18 11:05:52','2018-09-18 11:05:52','NZ','',0,NULL,'',''),(109,158,'9400501002939',NULL,'康维他PFL30蜂胶250粒','Comvita Propolis PFL30 250c',NULL,'attachment/img/2018-10-23/康维他蜂胶胶囊 250粒.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,0,NULL,'<p>康维他 蜂胶胶囊PFL30 &nbsp;250粒</p>\r\n\r\n<p>【英文名称】Comvita&nbsp;Propolis Capsules PFL 30</p>\r\n\r\n<p>【产品规格】250粒</p>\r\n\r\n<p>【产&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;地】新西兰</p>\r\n\r\n<p>【产品介绍】在树木较少的国家和污染严重的环境中，蜜蜂会采集石油等油性物质来代替树脂,所以这些地方出产的蜂胶会含有大量的铅，长期服用对身体破坏极大。康维他蜂胶产自新西兰未受污染地区的落叶树，那里的落叶树产生丰富类黄酮含量的天然树液和树脂以预防幼芽和裸露面受感染。蜜蜂采集树脂并添加入它们自己的特殊物质来制成蜂胶，蜜蜂常常用它来保护蜂房预防病毒，细菌和真菌感染。因此。蜂胶被誉为&ldquo;自然界的最佳防护品&rdquo;。</p>\r\n\r\n<p>蜂胶产品中，PFL代表蜂胶中最重要物质&ldquo;生物类黄酮&rdquo;的含量，它们是一组特殊抗氧化剂.是有效的自由基清除剂，能给人体提供强而有力的天然免疫系统并能促进细胞再生。</p>\r\n\r\n<p>新西兰工业研究和开发研究所和中华蜂胶协会测试并证明康维他蜂胶比其它诸多国际领先蜂胶品牌中的类黄酮含量明显要高。康维他蜂胶也比标有英国HFMA蜂胶中的类黄酮含量要高。康维他蜂胶产品中，PFL含量高出其它国际品牌产品三倍之多。</p>\r\n\r\n<p>【产品功效】</p>\r\n\r\n<p>有效的免疫系统剌激；<br />\r\n有效的浓缩抗氧化剂；<br />\r\n用途广泛，天然抗生素在与其它抗生素一起服用时能够产生一种协同效应；<br />\r\n有助净化和保护因有毒物质和酒精对肝脏的损坏；<br />\r\n保护细胞不受游历基伤害，促进细胞再生。</p>\r\n\r\n<p>【适用人群】</p>\r\n\r\n<p>需增加免疫力的人群<br />\r\n各种呼吸道疾病，如易感冒(病毒或细菌性,适合初期的感冒)，早上起床打喷嚏/流鼻水/肺部弱<br />\r\n消化不良，胃肠炎症及溃疡<br />\r\n烟酒过多，多应酬，压力大，经常外出公干或旅行人士<br />\r\n各种细菌性疾病，病毒性肝炎等<br />\r\n皮肤病，口腔炎，喉咙痛</p>\r\n\r\n<p>【使用方法】日常保养每日需服1-2粒，餐前服用效果更好。特殊需求，每天服用至多1－6片劑或膠囊作為一種有效的免疫系統增進劑及一種肝臟補劑，攝取其豐富的抗氧化活性物質。<img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-23/%E5%BA%B7%E7%BB%B4%E4%BB%96%E8%9C%82%E8%83%B6%E8%83%B6%E5%9B%8A%20250%E7%B2%92.jpg\" style=\"width: 814px; height: 814px;\" /></p>\r\n','','','2018-09-18 11:05:52','2018-09-18 11:05:52','NZ','',0,NULL,'',''),(110,180,'9400569013182',NULL,'好健康 生蚝精60粒','Good health Oyster Extract 60s',NULL,'attachment/img/2018-10-23/好健康 生蚝精60粒_主图1.jpg',11,11.5,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,2.00,0.00,NULL,0.00,NULL,0,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-23/%E5%A5%BD%E5%81%A5%E5%BA%B7%20%E7%94%9F%E8%9A%9D%E7%B2%BE60%E7%B2%92.jpg\" style=\"width: 814px; height: 7315px;\" /></p>\r\n','','','2018-09-18 11:05:52','2018-09-18 11:05:52','NZ','',0,NULL,'',''),(111,221,'9311096023233',NULL,'Paw patrol汪汪队饼干 200g','paw patrol character cookies 200g',NULL,'attachment/img/2018-10-23/汪汪队饼干.JPG',0,1,1,0,0,1,NULL,NULL,1,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,0,NULL,'','','','2018-09-18 11:05:52','2018-09-18 11:05:52','NZ','',0,NULL,'',''),(112,221,'9311096021840',NULL,'Peppa pig小猪佩琦饼干 200g','paw patrol character cookies 200g',NULL,'attachment/img/2018-10-23/小猪佩奇 (1).JPG',0,1,1,0,0,1,NULL,NULL,1,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,0,NULL,'<p>&nbsp;小猪佩奇peppa&nbsp;pig曲奇饼干来啦！明星效力真是大，kiwi小朋友们也人见人爱，无人工香料无人工色素，甜味不重，卡通造型确实很适合小朋友们食用。<br />\r\n<span style=\"font-size:14px;\"><span style=\"color:#e74c3c;\">一包两百克，大包内十小包</span></span>，还送一个<strong>卡通冰箱贴</strong>，总共24种冰箱贴等你搜集</p>\r\n','','','2018-09-18 11:05:52','2018-09