',NULL,'attachment/img/2018-10-21/HomeEssentials 玫瑰水.png',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,1,NULL,'<p>&nbsp;炒鸡划算+好用，Home&nbsp;Essentials&nbsp;玫瑰花水200ml&nbsp;，药房专卖！采植物之精华制成，渗透力强，深入活化皮肤，给皮肤带来新生，同时，维持皮肤的湿度平衡恢复皮肤活力与弹性，使皮肤柔嫩细致。天然玫瑰提取精华等有效缩小收敛毛孔，帮助调节肌肤水油平衡，同时具有很好的镇静效果</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>产品介绍&nbsp;PRODUCT INTRODUCTION</p>\r\n\r\n<p>Home Essentials 玫瑰花水爽肤水采植物之精华制成，渗透力强，深入活化皮肤，激发肌肤再生能力，给皮肤带来新生，同时，促进皮肤细胞的生长，维持皮肤的湿度平衡，防止皮肤过早老化，恢复皮肤活力与弹性，使皮肤柔嫩细致。天然玫瑰提取精华等有效缩小收敛毛孔，帮助调节肌肤水油平衡，同时具有很好的镇静效果。本品天然有机，100%纯天然，不含防腐剂、化学衍生物及人工色素或香料，是家庭理想的皮肤护理助手。</p>\r\n\r\n<p>○　规格：200ml</p>\r\n\r\n<p>○　品牌：Home Essentials</p>\r\n\r\n<p>○　产地：新西兰</p>\r\n\r\n<p>产品特点&nbsp;PRODUCT FEATURES</p>\r\n\r\n<p>○　富含纯天然玫瑰花精华活性成分，成分天然，所有肌肤类型均适用。</p>\r\n\r\n<p>○　携带使用简单、快捷。具有深层滋润及修护功效的爽肤水。</p>\r\n\r\n<p>○　质地温和易吸收，不刺激肌肤，不油腻，无添加任何人工色素、香精、防腐剂。</p>\r\n\r\n<p>产品功能&nbsp;BEAUTY FUNCTIONAL</p>\r\n\r\n<p>○　可以镇静舒缓肌肤，可以有效改善发炎、过敏的肌肤，消除红肿问题。</p>\r\n\r\n<p>○　滋润保湿，净透肌肤，令肌肤明亮有光感，恢复晶莹通透感。</p>\r\n\r\n<p>○　促进皮肤自我修复能力，深层修护皮脂膜，加强肌肤天然保护层。</p>\r\n\r\n<p>○　净化肌肤，疏通毛孔，紧致肌肤，抚平细纹，让肌肤恢复年轻状态。</p>\r\n\r\n<p>○　调节肌肤水油平衡，持久控油，改善粗糙皮肤。</p>\r\n\r\n<p>主要成份&nbsp;MAIN COMPONENTS</p>\r\n\r\n<p>○　玫瑰花精华</p>\r\n\r\n<p>适用人群&nbsp;SUITABLE FOR</p>\r\n\r\n<p>○　适用于任何肌肤类型使用，尤其是敏感皮肤的人群。</p>\r\n\r\n<p>使用方法&nbsp;HOW TO USE</p>\r\n\r\n<p>○　清洁面部后，用化妆棉取适量产品，轻涂于面部及颈部肌肤，有助于进一步清洁、补水，以促进后续护肤品的吸收。</p>\r\n','','','2018-09-18 11:05:57','2018-09-18 11:05:57','NZ','',0,NULL,'',''),(169,192,'9415293215962',NULL,'帕氏 Wildferns 小黄瓜撕拉面膜80ml','Parrs Rotorua Mud Mask Aloe Vera & Cucumber 80ml',NULL,'attachment/img/2018-10-21/帕氏小黄瓜面膜 (2).jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,0,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-21/%E5%B8%95%E6%B0%8F%E5%B0%8F%E9%BB%84%E7%93%9C%E9%9D%A2%E8%86%9C.jpg\" style=\"width: 750px; height: 1858px;\" /></p>\r\n','','','2018-09-18 11:05:57','2018-10-21 23:18:44','NZ','',0,NULL,'',''),(170,192,'9415293216037',NULL,'帕氏 Wildferns火山泥面膜青柠130ml','Parrs Rotorua Mud Facial Wash with Lime Blossom',NULL,'attachment/img/2018-10-21/帕氏火山泥黄瓜面膜 (3).JPG',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,0,NULL,'<p>帕氏火山泥芦荟+小黄瓜撕拉面膜：深层清洁皮肤,去黑头、除粉刺 ，更有利于皮肤营养的吸收,同时有利于废物的清除。取自 Rotorua独特的火山地热岩浆与为全天然火山泥無污染添加 ,来新西兰必入的火山泥,每周一至两次,用完整个皮肤都是滑滑嫩嫩的哟</p>\r\n','','','2018-09-18 11:05:57','2018-10-21 23:18:36','NZ','',0,NULL,'',''),(171,200,'9334518005228',NULL,'Chantelle羊胎素面膜 7片装','Chantelle facial mask 7sheets',NULL,'attachment/img/2018-10-21/Chantelle羊胎素面膜 7片装_主图2.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,2,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-21/Chantelle%E7%BE%8A%E8%83%8E%E7%B4%A0%E9%9D%A2%E8%86%9C.jpg\" style=\"width: 774px; height: 5991px;\" /></p>\r\n','','','2018-09-18 11:05:57','2018-09-18 11:05:57','NZ','',0,NULL,'',''),(172,158,'9414015002910',NULL,'Arataki蜂巢340g','Arataki 100% pure natural comb honey 340g',NULL,'attachment/img/2018-10-21/Arataki新西兰蜂巢_主图3.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,0,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-20/Arataki%E6%96%B0%E8%A5%BF%E5%85%B0%E8%9C%82%E5%B7%A2_desc5.jpg\" style=\"width: 790px; height: 973px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-20/Arataki%E6%96%B0%E8%A5%BF%E5%85%B0%E8%9C%82%E5%B7%A2_desc6.jpg\" style=\"width: 790px; height: 461px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-20/Arataki%E6%96%B0%E8%A5%BF%E5%85%B0%E8%9C%82%E5%B7%A2_desc7.jpg\" style=\"width: 790px; height: 1607px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-20/Arataki%E6%96%B0%E8%A5%BF%E5%85%B0%E8%9C%82%E5%B7%A2_desc8.jpg\" style=\"width: 790px; height: 517px;\" /></p>\r\n','','','2018-09-18 11:05:57','2018-09-18 11:05:57','NZ','',0,NULL,'',''),(173,192,'9416967912132',NULL,'Neat Feat脚裂膏75gx2',' Neat Feat Heel Balm  Health Care Foot Creams Treatments 75g*2',NULL,'attachment/img/2018-10-21/Neat Feat脚裂膏75g.JPG',0,1,1,0,0,1,NULL,NULL,NULL,1,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,2,NULL,'<p>【产品名称】： Neat Feat Foot &amp; Heel Balm 脚跟防干裂足部护理膏&nbsp;</p>\r\n\r\n<p>【产品规格】：一盒2支 2*75g&nbsp;</p>\r\n\r\n<p>【产品介绍】：脚跟龟裂是由于丧失水分从脚暴露在干燥的环境下的脚跟会造成损失的水分而导致在裂缝或裂缝发展。</p>\r\n\r\n<p>&nbsp;NEAT FEAT有效成分补充水份的肌肤，修护皮肤损害与5天内明显成效。一旦维修工作完成后，较轻的整洁壮举足部润肤霜可以用每天保持畅通的高跟鞋。整洁的壮举脚掌和脚跟膏被广泛用于糖niao病患者，以确保自己的皮肤保持光滑，防止开裂和脚恶化。</p>\r\n\r\n<p>&nbsp;有效防止因经常不穿袜子，疏于保护以及遗传性的脚部尤其是脚后跟开裂。用过以后皮肤光滑，防裂止痛，告别小橡皮膏的困扰。</p>\r\n\r\n<p>【使用方法】一天两次,清洗（热水浸泡10分钟）后直接涂抹少量的药膏于足跟周围，严重的部位可加以按摩，帮助皮肤吸收更好。</p>\r\n\r\n<p>【储藏方法】开封后请置于低于30度干燥环境</p>\r\n\r\n<p>Heel Balm 足跟软膏能在7天内有效修复，缓解粗糙干燥，有开裂的皮肤问题，并有临床试验证明。</p>\r\n\r\n<p>建议：涂抹药膏后，穿上一双全棉的袜子。</p>\r\n\r\n<p>【适用症状】</p>\r\n\r\n<p>1.特效配方，针对脚部肌肤粗糙、干燥、皲裂及皮肤厚问题。</p>\r\n\r\n<p>2.含25%化学综合体尿素，添加于高度浓缩保湿液及去角质成分。</p>\r\n\r\n<p>3.滋养、保湿、去角质及保护成分于一身。</p>\r\n\r\n<p>4.当穿新鞋子时，帮助缓解水泡及于鞋体摩擦。</p>\r\n','','','2018-09-18 11:05:57','2018-09-18 11:05:57','NZ','',0,NULL,'',''),(174,200,'9312146001300',NULL,'ThursdayPlantation茶树油25ml','Thursday Tea Tree Oil 25ml',NULL,'attachment/img/2018-10-21/星期四茶树油25ml10.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,2,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-21/%E6%98%9F%E6%9C%9F%E5%9B%9B%E8%8C%B6%E6%A0%91%E6%B2%B925ml.jpg\" style=\"width: 774px; height: 7079px;\" /></p>\r\n','','','2018-09-18 11:05:57','2018-09-18 11:05:57','NZ','',0,NULL,'',''),(175,NULL,'9421903137067',NULL,'Fresco羊奶粉450g','Fresco goat milk450g',NULL,'attachment/img/2018-10-14/Fresco 成人羊奶粉 450克.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,0,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-14/Fresco%E6%88%90%E4%BA%BA%E7%BE%8A%E5%A5%B6%E7%B2%89%20450%E5%85%8B%20(1).jpg\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-14/Fresco%E6%88%90%E4%BA%BA%E7%BE%8A%E5%A5%B6%E7%B2%89%20450%E5%85%8B%20(2).jpg\" style=\"width: 900px; height: 901px;\" />​​​​​​<img alt=\"\" src=\"http://yom