g alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-21/%E5%B0%8F%E6%B2%B3%E9%A9%AC%E6%B4%97%E5%8F%91%EF%BC%88%E9%BB%84%E8%89%B2%EF%BC%89.jpg\" style=\"width: 553px; height: 5520px;\" /></p>\r\n','','','2018-09-18 11:05:58','2018-09-18 11:05:58','NZ','',0,NULL,'',''),(181,193,'9330344002240',NULL,'Banana boat 成人防晒50+175g','Banana Boat Everyday SPF 50+ Sunscreen Spray 175g',NULL,'attachment/img/2018-10-21/IMG_8076.JPG',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,0,NULL,'<p><strong data-spm-anchor-id=\"2013.1.0.i0.2de6369bWERd3S\">蕉船日常SPF 50+ 防晒喷雾 175克</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>特点：</strong></p>\r\n\r\n<p><strong>&middot; 能广泛抵挡UVAI、UVAII、UVB紫外线</strong></p>\r\n\r\n<p><strong>&middot; 能减少对皮肤的刺激性</strong></p>\r\n\r\n<p><strong>&middot; 不油腻、不会阻塞毛孔，无色，无油，无香料，防水不含PBA</strong></p>\r\n\r\n<p><strong>&middot; 皮肤科医生测试并推荐</strong></p>\r\n\r\n<p><strong>&middot; 像水一样温和，低过敏性</strong></p>\r\n\r\n<p><strong>&middot; 贴心保护长达4小时</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>使用方法：</strong></p>\r\n\r\n<p><strong>均匀地涂在肌肤上，涂后15分钟才暴露在太阳下，游泳、抹身或隔一段时间应重覆涂抹以达至最佳防晒效果。</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>注意事项：</strong></p>\r\n\r\n<p><strong>1.务必在接触阳光前15分钟抹上。<br />\r\n2.虽然是防水的，但是在游泳或用湿毛巾试擦后，还是建议再重新涂上一层。<br />\r\n3.使用时，请先用力摇均匀。打开盖子对准目标区域，保持20-30厘米的距离，然后按压喷头按钮，一次性按到底，均匀地喷涂在身体上</strong></p>\r\n','','','2018-09-18 11:05:58','2018-09-18 11:05:58','NZ','',0,NULL,'',''),(182,192,'9316542120504',NULL,'Natio Ageless 面膜 100g','Natio Ageless Hydrating Mask 100g',NULL,'attachment/img/2018-10-21/Natio面膜_主图5.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,0,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-21/Natio%E9%9D%A2%E8%86%9C.jpg\" style=\"width: 774px; height: 5356px;\" /></p>\r\n','','','2018-09-18 11:05:58','2018-09-18 11:05:58','NZ','',0,NULL,'',''),(183,182,'9400501003448',NULL,'Comvita UMF10+ 康维他麦卢卡蜂蜜棒棒糖','Comvita Childrens Lemon and Honey Lollipops',NULL,'attachment/