&quot;Junior&quot; Insect Repellent Roll On with Antiseptics&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Repel婴幼儿驱蚊乳液走珠装/滚珠露 薰衣草味</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>【产品规格】60毫升</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;【产 地】新西兰</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;【适用范围】不仅防蚊，也适用于防止白蛉等昆虫的叮咬。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>【适用年龄】6个月以上</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>【使用方法】外用，涂抹于暴露在外的皮肤上。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>【储存方式】储存时，向上放置于30摄氏度以下。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>【有效时间】2-4小时</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>夏季，爸爸妈妈们有更多机会带宝宝外出游玩，天气炎热，蚊虫很多，为了宝宝肌肤健康，请备好婴幼儿驱蚊乳液。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;【产品介绍】&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>本产品在安全、无毒、对宝宝肌肤保湿的情况下，达到真正的有效避蚊。降低了驱蚊胺的含量和走珠易用包装，满足对低药剂含量客户的需求。正常情况下，6个月以上的婴幼儿可安全使用(如有疑虑，请先向医生咨询)，成人也适用。</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p>Apex Repel婴幼儿驱蚊乳液，将乳化剂封闭在硅树脂里，延长产品在皮肤上的有效时间，进而延长了再次使用的间隔时间。含抗菌剂以延长产品作用的有效性。走珠装，使用简单, &nbsp;即使在热带地区和旅行途中也安全有效。</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>防水，不含酒精，有股药味，携带、使用都很方便哦。</p>\r\n','','','2018-09-18 11:06:01','2018-09-18 11:06:01','NZ','',0,NULL,'',''),(218,192,'9421027311077',NULL,'Earthwise 河马宝宝儿童沐浴乳（蓝色） 添加羊奶 275ml','Earthwise baby by earthwise bubble body wash with goats milk 275ml',NULL,'attachment/img/2018-10-21/Earthwise婴儿有机羊奶沐浴露 蓝色小河马装 275ml.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,0,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-21/%E5%B0%8F%E6%B2%B3%E9%A9%AC%E5%AE%9D%E5%AE%9D%E6%B2%90%E6%B5%B4%E9%9C%B2%EF%BC%88%E8%93%9D%E8%89%B2%EF%BC%89.jpg\" style=\"width: 814px; height: 6525px;\" /></p>\r\n','','','2018-09-18 11:06:01','2018-09-18 11:06:01','NZ','',0,NULL,'',''),(219,192,'079656652055',NULL,'Banana boat SPF50+婴儿防晒霜90ml','Banana Boat sunscreean lotion （tear free） 90ml',NULL,'attachment/img/2018-10-21/香蕉船防晒 90ml02.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,0,NULL,'<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><strong data-spm-anchor-id=\"2013.1.0.i0.763f13beLWNi7f\">香蕉船 baby 宝宝防晒霜</strong></span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><strong>规格：</strong>90ml</span></span></span></p>\r\n\r\n<p align=\"center\" data-spm-anchor-id=\"2013.1.0.i1.763f13beLWNi7f\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><strong>包装：</strong>无盒有塑封</span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><strong>适合人群：</strong></span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\">适合各类儿童肌肤，<font color=\"#ff0000\">6个月以上婴儿与成人</font>，尤其敏感肌肤的MM们；<font color=\"#ff0000\">6个月以下宝宝使用前请咨询医生。</font></span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><strong>产品描述：</strong></span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\">纯物理防晒剂，不含PABA（对氨基苯甲酸），香料，不会被皮肤吸收，在皮肤表面可形成一层保护屏障，</span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\">不会过敏，适合于敏感皮肤的人使用；不含油分，所以使用舒适，毫无油腻感；防晒范围广泛：</span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\">可有效阻挡290nm－380nm范围内的UVB和UVA全面有效的阻挡紫外线对皮肤造成的损伤，防止皮肤光老化。</span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\">2013年香蕉船最新推出天然系列防晒霜，以它有效、温和、自然的特性细心呵护宝宝娇嫩柔弱的肌肤。</span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\">它是用100％天然来源的防晒活性成分，不含任何伤害性的化学防晒剂。经儿科医生测试，这</span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\">款天然防晒配方的防晒乳，在皮肤上形成保护层，以物理反射原理抵御日光中的UVA和UVB对皮肤的伤害。</span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><font color=\"#ff0000\">SPF50防晒指数的无泪无刺激超温和配方，辅以芦荟等舒缓成分，非常适合宝宝使用。</font></span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\"><strong>使用方法：</strong></span></span></span></p>\r\n\r\n<p align=\"center\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"background-color:#ffffff\">均匀地涂在肌肤上，涂上后15分钟才暴露在太阳下，游泳、抹身或隔一段时间应重覆涂抹以达至最佳防晒效果。</span></span></span></p>\r\n','','','2018-09-18 11:06:01','2018-09-18 11:06:01','NZ','',0,NULL,'',''),(220,192,'9415293201880',NULL,'Parrs 帕氏婴儿蜂蜜润肤乳 80ml','Parrs Honey Babe Moisture Creme 80ml tube',NULL,'attachment/img/2018-10-21/帕氏婴儿蜂蜜润肤乳 80ml_主图2.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,0,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-21/%E5%B8%95%E6%B0%8F%E5%A9%B4%E5%84%BF%E8%9C%82%E8%9C%9C%E6%B6%A6%E8%82%A4%E4%B9%B3%2080ml.jpg\" style=\"width: 774px; height: 2291px;\" /></p>\r\n','','','2018-09-18 11:06:01','2018-09-18 11:06:01','NZ','',0,NULL,'',''),(221,221,'9328121046341',NULL,'Binky bites小黄人饼干160g','Binky bites character cookies 160g',NULL,'attachment/img/2018-10-21/小黄人饼干.jpg',0,1,1,0,0,1,NULL,NULL,NULL,1,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,5,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-21/Binky%20bites%E5%B0%8F%E9%BB%84%E4%BA%BA%E9%A5%BC%E5%B9%B2160g01.jpg\" style=\"width: 576px; height: 5332px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-21/Binky%20bites%E5%B0%8F%E9%BB%84%E4%BA%BA%E9%A5%BC%E5%B9%B2160g02.jpg\" style=\"width: 664px; height: 4362px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-21/Binky%20bites%E5%B0%8F%E9%BB%84%E4%BA%BA%E9%A5%BC%E5%B9%B2160g03.jpg\" style=\"width: 774px; height: 3925px;\" /></p>\r\n','','','2018-09-18 11:06:01','2018-09-18 11:06:01','NZ','',0,NULL,'',''),(222,177,'9415991233275',NULL,'Red seal覆盆子茶35g','Red Seal Raspberry Leaf Tea 35g',NULL,'attachment/img/2018-10-21/红印覆盆子茶.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,0,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-21/%E7%BA%A2%E5%8D%B0%E8%A6%86%E7%9B%86%E5%AD%90%E8%8C%B6.jpg\" style=\"width: 711px; height: 7349px;\" /></p>\r\n','','','2018-09-18 11:06:01','2018-09-18 11:06:01','NZ','',0,NULL,'',''),(223,158,'9316090500605',NULL,'Osteli