n\r\n<p>保存方法：请置于阴凉处。</p>\r\n\r\n<p>适用年龄：全阶段。已经学会或者在家长指导下会刷牙的婴幼儿。</p>\r\n\r\n<p>注意事项：每8周或破损初期更换一次牙刷，生病后需更换牙刷，使用前后请彻底冲洗牙刷，勤消毒并且保持牙刷存放于干燥处，4岁以下儿童需在成人监督下使用，请勿咬或吞咽牙刷。</p>\r\n\r\n<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-20/JJ%E7%89%99%E5%88%B7_desc1.jpg\" style=\"width: 790px; height: 932px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-20/JJ%E7%89%99%E5%88%B7_desc2.jpg\" style=\"width: 790px; height: 936px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-20/JJ%E7%89%99%E5%88%B7_desc3.jpg\" style=\"width: 790px; height: 1128px;\" /></p>\r\n','','','2018-09-18 11:06:08','2018-09-18 11:06:08','NZ','',0,NULL,'',''),(296,NULL,'9415077098200',NULL,'Pams 藜麦 红豆 450g','Pams red quinoa 450g',NULL,'',0,1,1,0,0,1,0,0,0,0,0,NULL,0,1,0.00,0.00,NULL,0.00,NULL,0,NULL,'',NULL,NULL,'2018-09-18 11:06:08','2018-09-18 11:06:08',NULL,NULL,0,NULL,NULL,NULL),(297,NULL,'670983097559',NULL,'jellycat 灰色huge','jellycat huge bunny（gray）',NULL,'',0,1,1,0,0,1,0,0,0,0,0,NULL,0,1,0.00,0.00,NULL,0.00,NULL,0,NULL,'',NULL,NULL,'2018-09-18 11:06:08','2018-09-18 11:06:08',NULL,NULL,0,NULL,NULL,NULL),(298,192,'9421900569793',NULL,'antipodes juliet洗面奶 200ml','Antipodes Juliet Skin Brightening Gel Cleanser 200ml',NULL,'attachment/img/2018-10-20/Antipodes洗面奶_主图2.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,2,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-20/Antipodes%E6%B4%97%E9%9D%A2%E5%A5%B6_desc1.jpg\" style=\"width: 750px; height: 8683px;\" /></p>\r\n','','','2018-09-18 11:06:08','2018-09-18 11:06:08','NZ','',0,NULL,'',''),(299,NULL,'9349254002035',NULL,' goat羊奶皂麦卢卡蜂蜜 100g','Goat soap with Manuka Honey 100g',NULL,'attachment/img/2018-10-14/goat soap羊奶皂_主图3.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,0,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-14/goat%20soap%E7%BE%8A%E5%A5%B6%E7%9A%8201.jpg\" style=\"width: 814px; height: 6