;地】100%新西兰原装进口</p>\r\n\r\n<p>【适用范围】不仅防蚊，也适用于防止白蛉等昆虫的叮咬。</p>\r\n\r\n<p>【适用年龄】6个月以上</p>\r\n\r\n<p>【使用方法】外用，涂抹于暴露在外的皮肤上。</p>\r\n\r\n<p>【储存方式】储存时，向上放置于30摄氏度以下。</p>\r\n\r\n<p>【有效时间】2-4小时</p>\r\n\r\n<p>夏季，爸爸妈妈们有更多机会带宝宝外出游玩，天气炎热，蚊虫很多，为了宝宝肌肤健康，请备好婴幼儿驱蚊乳液。</p>\r\n','','','2018-09-18 11:06:12','2018-10-20 23:09:44','NZ','',0,NULL,'',''),(348,200,'9421017760076',NULL,'trilogy 玫瑰保湿日霜 60ml','Trilogy Rose Vital Moisturising Cream 60ml',NULL,'attachment/img/2018-10-20/Trilogy 野玫瑰保湿面霜 60克.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,1,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-20/ed9a876d860ed71b.jpg\" style=\"width: 790px; height: 3770px;\" /></p>\r\n','','','2018-09-18 11:06:12','2018-09-18 11:06:12','10','',0,NULL,'',''),(349,192,'9314839004759',NULL,'ego 小章鱼面霜 100g','QV kids moisturising cream100g',NULL,'attachment/img/2018-10-20/QV 儿童润肤膏（balm）100g.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,0.00,NULL,0.00,NULL,2,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-20/%E5%B0%8F%E7%AB%A0%E9%B1%BC%E9%9D%A2%E9%9C%9C100G.jpg\" style=\"width: 750px; height: 998px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-20/%E5%B0%8F%E7%AB%A0%E9%B1%BC%E9%9D%A2%E9%9C%9C100G1.jpg\" style=\"width: 790px; height: 371px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-20/%E5%B0%8F%E7%AB%A0%E9%B1%BC%E9%9D%A2%E9%9C%9C100G2.jpg\" style=\"width: 790px; height: 439px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-20/%E5%B0%8F%E7%AB%A0%E9%B1%BC%E9%9D%A2%E9%9C%9C100G3.jpg\" style=\"width: 790px; height: 390px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-20/%E5%B0%8F%E7%AB%A0%E9%B1%BC100g4.jpg\" style=\"width: 790px; height: 483px;\" /></p>\r\n','','','2018-09-18 11:06:12','2018-09-18 11:06:12','NZ','',0,NULL,'',''),(350,192,'9314839011948',NULL,'ego 小老虎面霜 250g','Ego QV baby cream 250g',NULL,'attachment/img/2018-10-19/小老虎250g.j